// SPDX-License-Identifier: MIT

pragma solidity ^0.6.0;

import "./interfaces/IBEP20.sol";
import "./interfaces/IBStablePool.sol";
import "./interfaces/IBSTMinter.sol";
import "./interfaces/IBSTToken.sol";
import "./interfaces/IBSTFarmingProxy.sol";
import "./lib/SafeBEP20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/// @title Implement liquitidy farming.
contract LiquidityFarmingProxy is Ownable, IBSTFarmingProxy {
    using SafeMath for uint256;
    using SafeBEP20 for IBEP20;
    struct UserInfo {
        uint256 amount; /// @dev How many LP tokens the user has provided.
        uint256 rewardDebt; /// @dev Reward debt. See explanation below.
    }
    /// @notice Info of each pool.
    struct PoolInfo {
        IBEP20 lpToken; /// @dev Address of LP token contract.
        uint256 accTokenPerShare; /// @dev Accumulated BSTs per share, times 1e12. See below.
    }
    string public name = "BStable Liquidity Farming Proxy";
    string public symbol = "BLFP-V1";
    IBSTToken public token;
    /// @notice Info of each pool.
    PoolInfo[] public poolInfo;
    /// @notice Save lp tokens whether exists.
    mapping(address => bool) public lpTokens;
    /// @notice Info of each user that stakes LP tokens.
    mapping(uint256 => mapping(address => UserInfo)) public userInfo;
    /// @notice For mint BST
    IBSTMinter public bstMinter;

    modifier onlyMinter() {
        require(
            address(bstMinter) == msg.sender,
            "LiqudityFarmingProxy: caller is not the bstMinter"
        );
        _;
    }
    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);
    event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event EmergencyWithdraw(
        address indexed user,
        uint256 indexed pid,
        uint256 amount
    );
    event SetMinter(address _minter);
    event AddPool(address _poolAddress);
    event SetPool(uint256 _pid);
    event UpdatePool(
        uint256 _pid,
        uint256 accTokenPerShare,
        uint256 _tokenReward
    );
    event CalculatePending(
        uint256 _pid,
        uint256 _amount,
        uint256 rewardDebt,
        uint256 accTokenPerShare,
        uint256 pending
    );
    event SetToken(address _token);
    event ZeroLPStaking(
        uint256 _pid,
        uint256 _lastRewardBlock,
        uint256 blockNumber
    );

    constructor(address ownerAddress) public {
        require(
            ownerAddress != address(0),
            "LiquidityFarmingProxy: no 0 address"
        );
        transferOwnership(ownerAddress);
    }

    function setMinter(IBSTMinter _minter) public onlyOwner {
        require(
            address(_minter) != address(0),
            "LiquidityFarmingProxy: no 0 address"
        );
        bstMinter = _minter;
        emit SetMinter(address(_minter));
    }

    function poolLength() external view returns (uint256) {
        return poolInfo.length;
    }

    /// @notice Add a new lp to the pool. Can only be called by the owner.
    function add(
        IBEP20 _lpToken,
        uint256 _allocPoint,
        bool _withUpdate
    ) external onlyOwner {
        require(
            address(_lpToken) != address(0),
            "LiquidityFarmingProxy: no 0 address"
        );
        require(
            !lpTokens[address(_lpToken)],
            "LiqudityFarmingProxy: _lpToken already exist"
        );
        lpTokens[address(_lpToken)] = true;
        if (_withUpdate) {
            bstMinter.massUpdateProxy();
        }
        bstMinter.add(_allocPoint, address(_lpToken));
        poolInfo.push(PoolInfo({lpToken: _lpToken, accTokenPerShare: 0}));
        emit AddPool(address(_lpToken));
    }

    /// @notice Update the given pool's BST allocation point. Can only be called by the owner.
    function set(
        uint256 _pid,
        uint256 _allocPoint,
        bool _withUpdate
    ) external onlyOwner {
        require(
            _pid < poolInfo.length,
            "LiqudityFarmingProxy: pid out of range."
        );
        if (_withUpdate) {
            bstMinter.massUpdateProxy();
        }
        bstMinter.set(address(poolInfo[_pid].lpToken), _allocPoint);
        emit SetPool(_pid);
    }

    /// @notice View function to see pending BSTs on frontend.
    function pendingReward(uint256 _pid, address _user)
        external
        view
        returns (uint256)
    {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][_user];
        uint256 accTokenPerShare = pool.accTokenPerShare;
        uint256 lpSupply = pool.lpToken.balanceOf(address(this));
        (, uint256 _lastRewardBlock) =
            bstMinter.getPoolInfo(address(this), address(pool.lpToken));
        if (block.number > _lastRewardBlock && lpSupply != 0) {
            uint256 tokenReward =
                bstMinter.getReward(address(this), address(pool.lpToken));
            uint256 nAccTokenPerShare =
                tokenReward == 0 ? 0 : tokenReward.mul(1e12).div(lpSupply);
            accTokenPerShare = accTokenPerShare.add(nAccTokenPerShare);
        }
        return user.amount.mul(accTokenPerShare).div(1e12).sub(user.rewardDebt);
    }

    /// @dev Mass update pools. Only caller is BSTMinter's massUpdateProxy.
    function massUpdate() public override onlyMinter {
        _massUpdatePools();
    }

    /// @notice Update reward vairables for all pools. Be careful of gas spending!
    function _massUpdatePools() internal {
        uint256 length = poolInfo.length;
        for (uint256 pid = 0; pid < length; ++pid) {
            _updatePool(pid);
        }
    }

    /// @notice Update reward variables of the given pool to be up-to-date.
    /// @param _pid pool's index.
    function _updatePool(uint256 _pid) internal {
        require(
            _pid < poolInfo.length,
            "LiqudityFarmingProxy: pid out of range."
        );
        PoolInfo storage pool = poolInfo[_pid];
        (, uint256 _lastRewardBlock) =
            bstMinter.getPoolInfo(address(this), address(pool.lpToken));
        if (block.number <= _lastRewardBlock) {
            return;
        }
        uint256 lpSupply = pool.lpToken.balanceOf(address(this));
        if (lpSupply == 0) {
            bstMinter.updateLastRewardBlock(address(pool.lpToken));
            emit ZeroLPStaking(_pid, _lastRewardBlock, block.number);
            return;
        }
        uint256 tokenReward = bstMinter.mint(address(pool.lpToken));
        pool.accTokenPerShare = pool.accTokenPerShare.add(
            tokenReward.mul(1e12).div(lpSupply)
        );
        emit UpdatePool(_pid, pool.accTokenPerShare, tokenReward);
    }

    /// @notice Deposit LP tokens to BStableProxyV2 for BST allocation.
    function deposit(uint256 _pid, uint256 _amount) public {
        require(
            _pid < poolInfo.length,
            "LiqudityFarmingProxy: pid out of range."
        );
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        _updatePool(_pid);
        if (user.amount > 0) {
            uint256 pending =
                user.amount.mul(pool.accTokenPerShare).div(1e12).sub(
                    user.rewardDebt
                );
            emit CalculatePending(
                _pid,
                user.amount,
                user.rewardDebt,
                pool.accTokenPerShare,
                pending
            );
            safeTokenTransfer(msg.sender, pending);
        }
        user.amount = user.amount.add(_amount);
        user.rewardDebt = user.amount.mul(pool.accTokenPerShare).div(1e12);
        if (_amount > 0) {
            pool.lpToken.safeTransferFrom(
                address(msg.sender),
                address(this),
                _amount
            );
        }
        emit Deposit(msg.sender, _pid, _amount);
    }

    /// @notice Withdraw LP tokens .
    function withdraw(uint256 _pid, uint256 _amount) public {
        require(
            _pid < poolInfo.length,
            "LiqudityFarmingProxy: pid out of range."
        );
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        require(user.amount >= _amount, "withdraw: not good");
        _updatePool(_pid);
        uint256 pending =
            user.amount.mul(pool.accTokenPerShare).div(1e12).sub(
                user.rewardDebt
            );
        emit CalculatePending(
            _pid,
            user.amount,
            user.rewardDebt,
            pool.accTokenPerShare,
            pending
        );
        if (pending > 0) {
            safeTokenTransfer(msg.sender, pending);
        }
        user.amount = user.amount.sub(_amount);
        user.rewardDebt = user.amount.mul(pool.accTokenPerShare).div(1e12);
        if (_amount > 0) {
            pool.lpToken.safeTransfer(address(msg.sender), _amount);
        }
        emit Withdraw(msg.sender, _pid, _amount);
    }

    /// @notice Withdraw without caring about rewards. EMERGENCY ONLY.
    function emergencyWithdraw(uint256 _pid) public {
        require(
            _pid < poolInfo.length,
            "LiqudityFarmingProxy: pid out of range."
        );
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        uint256 amount_ = user.amount;
        user.amount = 0;
        user.rewardDebt = 0;
        pool.lpToken.safeTransfer(address(msg.sender), amount_);
        emit EmergencyWithdraw(msg.sender, _pid, amount_);
    }

    /// @notice Safe token transfer function, just in case if rounding error causes pool to not have enough BSTs.
    function safeTokenTransfer(address _to, uint256 _amount) internal {
        require(_to != address(0), "LiquidityFarmingProxy: no 0 address");
        uint256 tokenBal = token.balanceOf(address(this));
        if (_amount > tokenBal) {
            token.transfer(_to, tokenBal);
        } else {
            token.transfer(_to, _amount);
        }
    }

    function setToken(IBSTToken _token) external onlyOwner {
        require(
            address(_token) != address(0),
            "LiquidityFarmingProxy: no 0 address"
        );
        token = _token;
        emit SetToken(address(_token));
    }

    function getTokenAddress() external view returns (address) {
        return address(token);
    }
}
